import React from 'react';


const ProductoItem = (props)=>{
    const {descripcion, precio,cantidad,imagen,body} = props;
    return(
        <div class="contenedor-img">
<div className="item">
      <figure>
        <img src={imagen} className="img-s" alt={descripcion} />
      </figure>
      <div className="info-item">
        <h2>Descripcion: {descripcion}</h2>
        <p className="precio">Precio: ${precio}</p>
        <p className="cantidad">Cantidad:{cantidad}</p>
        <button className="bn">Lo quiero!</button>
      </div>
    </div>
    </div>
    );
}

export default ProductoItem;
